import React from 'react'

const defaultProps = {
    backgroundImage: "https://mdbootstrap.com/img/Photos/Others/architecture.jpg" ,
}

export default class Container extends React.Component {
    render () {
        return (
            <div className="jumbotron animated fadeIn delay-06s delay-1s" style={{backgroundImage: `url('${!this.props.backgroundImage ? defaultProps.backgroundImage : this.props.backgroundImage}')`, color: '#000000'}}>
                <div className="container">
                    <h2 className="display-3 text-center animated fadeInLeft delay-06s">{this.props.title }</h2>
                </div>
            </div>
        )
    }
}
